import React from 'react';
import './App.css';
import Beer from './component/beer';
import BeerList from "./component/beer_list";

function App() {
  return (
      <div className="App">
          {new BeerList({
              beers: [new Beer("corona"),new Beer("86")]
          }).render()}
      </div>
  );
}

export default App;
